window.bookSummaryJSON = "<p>\"This is a must-read for anyone in their Daddy era! Have fun and bring a fan because this one is hot from page one to the end.\"<br> <br> After finding out the baby his fiancée is carrying is not biologically his, Theo Reeves leaves town and vows to never come back.</p> <p>That is until, 22 years later he returns to handle his late mother’s estate. The hatred of being back in his hometown drives him to a dive bar just outside city limits.</p> <p>A night he planned on spending alone and drinking away the memories, is interrupted by a blonde half his age he can't help but be drawn to. Something about her green eyes and the way she despises this town nearly as much as he does, has him wanting to make some reckless decisions.</p> <p>Aria Mason was never given the chance to be seen as anything other than “the affair baby”. Having spent the last 21 years getting side-eyed and excluded, the attention from an attractive stranger was a breath of fresh air.</p> <p>That air was ripped from her lungs the second she found out this mysterious tattooed stranger, she let ravage her in the dingy bar bathroom, was actually her mom’s ex-fiancee, and was the man she was supposed to grow up calling Daddy.</p>"; 
